import "./App.css";

const App = () => {
  return (
    <div>
      <div></div>
      <div className="App">
        <ul>
          <li>html</li>
          <li>css</li>
          <li>js</li>
        </ul>
      </div>
    </div>
  );
};
const Header = () => {
  return (
    <div>
      <a> Home</a>
      <a> News Feed</a>
      <a> Massage</a>
    </div>
  );
};

export default App;
